import React, { Component } from 'react'
import Cardun from '../dashboard/Cardun'


import './admin.css';


class Formun extends Component {

  render () {

    return (
      <div>
        <form>
        <label>
          Nom : 
          <input type="text" name="name" />
        </label>
        <input type="submit" value="Envoyer" />
      </form>
      <Cardun/>
      </div>

    )
  }
}

export default Formun
